Grateful for being once again on the roof of Africa for the 13th time with my first wonderful Latin American group from my agency @cumbretours. I love my guiding job and even more so with such great people. Tanzania has become one of my favorite places in the World for its people full of energy, charisma and love for their mountain and the tourists. Kilimanjaro is fascinating for its natural diversity, its people and its postcard sunrises. No doubt mountaineering in Africa makes this 7summit one of the most special! Asante Sana! Thanks to @aktivferien_com for the impeccable logistics always. This is just the start, we continue in this adventure in Africa!

